import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';  // App 컴포넌트를 가져옵니다.
import './index.css';     // 기본 스타일 시트를 가져옵니다.

ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);
